  `balance` decimal(8, 2) UNSIGNED NOT NULL COMMENT '余额',
  `pm` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '0：支出 1：收入',
  `create_time` int(10) UNSIGNED NOT NULL DEFAULT 0,
